### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Software Testing Fundamentals**
- **Graph Coverage Criteria**: Node coverage, edge coverage, edge-pair coverage, prime path coverage.
- **Finite State Machines (FSM)**: State coverage.
- **Integration Testing**: Top-down approach, test stubs, test drivers.

#### 2. **Logical Predicates and Conditions**
- **Predicate Logic**: Understanding predicates and their conditions.
  - Example: \( p = \neg a \lor (b \land c) \)
  - Conditions under which a clause determines the predicate.
- **Conjunctive Normal Form (CNF) and Disjunctive Normal Form (DNF)**:
  - CNF: Conjunction of disjunctions.
  - DNF: Disjunction of conjunctions.
- **Truth Tables**: Analyzing truth tables for predicates.
  - Example: \( p = (a \land c) \lor \neg b \)

#### 3. **Equivalence Class Partitioning**
- **Boundary Value Analysis (BVA)**: Identifying test inputs that satisfy BVA.
  - Example: For a score range \( 0 \leq score \leq 120 \), test inputs could be \(\{-3, 0, 30, 40, 120, 125\}\).
- **Equivalence Class Partitions**: Identifying partitions based on ranges.
  - Example: CGPA ranges for tuition fee waivers.

#### 4. **Control Flow Graphs (CFG)**
- **Linearly Independent Paths**: Identifying paths in a CFG.
  - Example: \( G = \{V, E\} \) where \( V = \{1, 2, 3, 4, 5, 6, 7\} \) and \( E = \{(1,2), (2,3), (2,7), (3,4), (4,5), (5,3), (5,6), (6,7)\} \).
- **Edge-Pair Coverage**: Calculating test requirements for edge-pair coverage.
- **Edge Coverage**: Minimum number of test paths to achieve edge coverage.

#### 5. **Concolic Testing**
- **Symbolic Execution**: Using symbolic values for variables.
  - Example: \( a_0, b_0, c_0 \) for variables \( a, b, c \).
- **Path Constraints**: Generating path constraints for different execution paths.
  - Example: Path constraints for reaching an `abort()` call.
- **Concrete Test Inputs**: Identifying sets of concrete test inputs for symbolic execution.

#### 6. **Requirements Analysis**
- **Types of Requirements**: Business requirements, usability requirements, non-functional requirements, regulatory requirements.
  - Example: Monthly sales report requirement is a business requirement.

